t24App.controller('thankYouCtrl', ['$scope','$state','appService','$sessionStorage', function($scope,$state,appService,$sessionStorage){
	console.log('thankYouCtrl');
	var custToken = "E5303E3631BCC91B2CE2C42FD1269D0D8B9C14268D4AA7051D9E0162D524D7D090C1EC5E453618EA";
	var registeredId = "9727743579";
	$scope.loadTxnHistory = function(){
		appService.getTxnHistory(custToken,registeredId,function(response){
			console.log(response.data.slice(-1)[0]);
			$scope.lastTranscation = response.data.slice(-1)[0];

			appService.payUTxnStatusCheck(custToken,registeredId,$scope.lastTranscation.txnNo,function(response){
				console.log(response,response.data[0].paymentStatus);
				switch(response.data[0].paymentStatus){
					case '15050': alert("Payment Successful");
					break;
					case '15999': alert("Payment Failure");
					break;
					case '15998': alert("Pending : Temporary Failure");
					break;
					case '15020': alert("Invalid Transaction");
					break;
					case '15010': alert("Processing");
					break;
					default :console.log("payment status is not matched");
					break;
				}
				switch(response.data[0].benifitStatus){
					case '1': alert("Benifit Successful");
					break;
					case '0': alert("Benifit Failure");
					break;
					case '9': alert("Benifit Processing");
					break;
					default :console.log("Benifit is not matched");
					break;
				}

			});
		});
	};

	$scope.loadTxnHistory();
}]);
